   }
   clickfun=()=>{
    console.log("constructer call");
   }
    render() {
        console.log("render  call");
        return (
            <div>
                <button onClick={this.clickfun}>click</button>
            </div>
        )
    }
}

export default Lifecyclemethodtesting

